import React, { useEffect,useState } from 'react'







const Select = (props) => {

  
    const [options, setOptions] = useState(new Array(121));

    useEffect(() => {
        let arr =new Array(121);
        
        console.log("lenght is: ",arr.length)


        arr.forEach((elem,idx)=>{
            arr.push(idx)
            console.log(idx)
        })


    
        setOptions(arr)
        console.log("arr is ",arr)
    }, [])



    return (

        <select
            value={props.age}
            onChange={props.HandleInputEvent}
        // className={validation.isOnChangEventAge && age == 'Age' ? classes.red : classes.select}

        >
            <option defaultValue="Age">Age</option>
            {
                options.forEach((elem,idx) => {

                    return <option key={idx} value={idx}>{idx}</option>
                })
            }

        </select>
    )
}

export default Select
